import { useParams } from "react-router-dom";
import { Fragment } from "react";

const QuotesDetail = () => {
  const params = useParams();
  return (
    <Fragment>
      <h1>Quote Detail Page {params.quoteId}</h1>
    </Fragment>
  );
};

export default QuotesDetail;
